package dota2

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

var result string

var tests = []struct {
	input    string
	expected string
}{
	{"DDRRR", "Dire"},
	{"RDD", "Dire"},
	{"RD", "Radiant"},
	{
		"DRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDRDRRDRDRDRDDRDRDR",
		"Radiant",
	},
	{
		"",
		"Radiant",
	},
	{
		"",
		"Dire",
	},
}

func TestPredictPartyVictory(t *testing.T) {

	for i, v := range tests {
		t.Log("test: ", i+1)
		got := predictPartyVictory(v.input)
		assert.Equal(t, v.expected, got)
	}
}

func BenchmarkPredictPartyVictory(b *testing.B) {
	funcs := []struct {
		name string
		f    func(string) string
	}{
		{"mine", predictPartyVictory},
		//{"mine-v2", predictPartyVictoryV2},
		{"leet-fastest", predictPartyVictory_leet4ms},
	}

	var res string
	for _, fun := range funcs {
		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[5].input)
			}
		})
	}

	result = res
}
